let tableArray;

export default function HomePage({onChange, newState}){


    tableArray = getData(newState)



    return (
        <div className='App'>

            <div style={{display: "grid", gridTemplateColumns: "1fr 2fr 1fr"}}>
                <div></div>
                <div><h1>FAKYAK HOMEPAGE</h1></div>
                <div>
                <button onClick={onChange}>LOG OUT</button>
                </div>

            </div>


            <div>
                <div>
                <label>Post Content: </label>
                </div>
                <div>
                <textarea id="w3review" name="w3review" rows="4" cols="50"></textarea>
                </div>


                <button onClick={() => {
                    console.log("You clicked me!")
                }}>SUBMIT</button>
            </div>
                <br/>
                <br/>
                <br/>
                <br/>
                <div>
                    <button>Get Data</button>
                </div>

        </div>
    )
}


async function getData(newState) {
    const url = `http://127.0.0.1:5000/getUser/${newState[1]}`;
    try {
      const response = await fetch(url);
      if (!response.ok) {
        throw new Error(`Response status: ${response.status}`);
      }

      const json = await response.json();
      return json;
    } catch (error) {
      console.error(error.message);
    }
  }
